import React from 'react';
import lan from '../media/programme/BUT1/lan.png';

const BUT1 = () => {
    return (
        <div className="divBUT1">
            <h3>Le déroulement de la première année</h3>
            <p>La première année est une introduction au monde des réseaux et télécommunication.
                Elle a pour but de vous introduire dans cette univers en vous apprenant les bases.
            </p>
            <span>Partie Réseaux :</span>
            <p>Dans la partie réseaux, vous allez apprendre ce qu'est un réseau, 
                comment ça fonctionne et comment configurer les différents appareil qui composent un réseau local. <br />
                Par exemple vous allez apprendre ce qu'est un serveur DNS, DHCP, comment les pc peuvent communiquer entre eux, ...</p>
            <div className="imgBUT1">
            <img src={lan} alt="Réseau Local de base" className="lan"></img>
            </div>
            <span>Partie téléphonie/signal :</span>
            <p>Dans cette partie, vous allez apprendre à mesurer et analyser des signaux. 
                Vous allez donc voir comment ce transmet une information à travers un signal. <br />
                </p>
        </div>
    );
};

export default BUT1;
